/** @format */
import React, { useState } from "react";
import { Input } from "../components/ui/input";
import { Label } from "../components/ui/label";
import { Textarea } from "../components/ui/textarea";
import { Button } from "../components/ui/button";
import { toast } from "sonner";
import { useNavigate } from "react-router-dom";

const UploadProject = () => {
 const [projectTitle, setProjectTitle] = useState("");
 const [projectDescription, setProjectDescription] = useState("");
 const [projectFile, setProjectFile] = useState(null);
 const [category, setCategory] = useState("");
 const [loading, setLoading] = useState(false);

 const navigate = useNavigate();

 const handleSubmit = async (e) => {
  e.preventDefault();

  if (!projectFile) {
   toast.error("Please select a file!");
   return;
  }

  if (!category) {
   toast.error("Please select a category!");
   return;
  }

  setLoading(true);

  const formData = new FormData();
  formData.append("title", projectTitle);
  formData.append("description", projectDescription);
  formData.append("file", projectFile);
  formData.append("category", category);

  const user = JSON.parse(localStorage.getItem("user"));
  if (user?._id) {
   formData.append("uploadedBy", user._id);
  }

  try {
   const res = await fetch("http://127.0.0.1:5000/api/projects/upload", {
    method: "POST",
    headers: {
     Authorization: `Bearer ${localStorage.getItem("token")}`,
    },
    body: formData,
   });

   const data = await res.json();

   if (res.ok && data.project?._id) {
    toast.success("Project uploaded successfully!");

    // ✅ Clear fields
    setProjectTitle("");
    setProjectDescription("");
    setProjectFile(null);
    setCategory("");

    // ✅ Redirect to /projects
    setTimeout(() => {
     navigate("/projects", { replace: true });
    }, 1200);
   } else {
    toast.error(data.msg || "Failed to upload project");
   }
  } catch (error) {
   console.error(error);
   toast.error("Something went wrong!");
  } finally {
   setLoading(false);
  }
 };

 return (
  <div className="max-w-md mx-auto p-6 bg-white rounded shadow">
   <h2 className="text-2xl font-bold mb-4">Upload New Project</h2>

   <form onSubmit={handleSubmit} className="space-y-4">
    {/* ✅ Title */}
    <div className="space-y-2">
     <Label htmlFor="title">Project Title *</Label>
     <Input
      id="title"
      placeholder="Enter project title"
      value={projectTitle}
      onChange={(e) => setProjectTitle(e.target.value)}
      required
     />
    </div>

    {/* ✅ Description */}
    <div className="space-y-2">
     <Label htmlFor="description">Description *</Label>
     <Textarea
      id="description"
      placeholder="Enter project description"
      value={projectDescription}
      onChange={(e) => setProjectDescription(e.target.value)}
      required
     />
    </div>

    {/* ✅ Category Dropdown */}
    <div className="space-y-2">
     <Label htmlFor="category">Category *</Label>
     <select
      id="category"
      className="w-full border rounded-md p-2"
      value={category}
      onChange={(e) => setCategory(e.target.value)}
      required>
      <option value="">Select Category</option>
      <option value="Artificial Intelligence">Artificial Intelligence</option>
      <option value="Blockchain">Blockchain</option>
      <option value="Cloud Computing">Cloud Computing</option>
      <option value="Web Development">Web Development</option>
      <option value="Mobile Development">Mobile Development</option>
      <option value="Data Science">Data Science</option>
      <option value="Cybersecurity">Cybersecurity</option>
      <option value="IoT & Embedded">IoT & Embedded</option>
     </select>
    </div>

    {/* ✅ File Upload */}
    <div className="space-y-2">
     <Label htmlFor="file">Upload File (pdf, pptx, docx, txt) *</Label>
     <Input
      id="file"
      type="file"
      accept=".pdf,.pptx,.docx,.txt"
      onChange={(e) => setProjectFile(e.target.files[0])}
      required
     />
    </div>

    {/* ✅ Submit Button */}
    <Button type="submit" variant="hero" className="w-full" disabled={loading}>
     {loading ? "Uploading..." : "Submit Project"}
    </Button>
   </form>
  </div>
 );
};

export default UploadProject;
